function initUnlock(e) {
  if (e && e.user == null) {
    return;
  }
  if (typeof W === 'undefined' ||
      typeof W.loginManager === 'undefined') {
    setTimeout(initUnlock, 100);
    return;
  }
  if (typeof I18n === 'undefined') {
    log('No internationalisation object found yet, snoozing');
    setTimeout(initUnlock, 300);
    return;
  }
  if (!W.loginManager.isLoggedIn()) {
    W.loginManager.events.register("login", null, initUnlock);
    W.loginManager.events.register("loginStatus", null, initUnlock);
    return;
  }
  if (typeof W.loginManager.user === 'undefined' ||
      typeof W.loginManager.user.areas === 'undefined') {
    log('Waiting for user areas....');
    setTimeout(initUnlock, 300);
    return;
  }
  log('Initalizing settings...');
  initSettings();
}

function initBelgiumAreas(){
  log('Loading BE areas');
  let GeoJSON = new OL.Format.GeoJSON();
  let Flanders = GeoJSON.parseGeometry(FlandersGeoJSON);
  for (var c = 0; c < Flanders.components[0].components.length; c++) {
    Flanders.components[0].components[c].calculateBounds();
    FlanderAreas.push(Flanders.components[0].components[c]);
  }
  let Wallonia = GeoJSON.parseGeometry(WalloniaGeoJSON);
  for (var c = 0; c < Wallonia.components[0].components.length; c++) {
    Wallonia.components[0].components[c].calculateBounds();
    WalloniaAreas.push(Wallonia.components[0].components[c]);
  }
}

function initSettings() {
  var prefsTab = document.querySelector('#sidepanel-prefs');
  if (!prefsTab) {
    log('No settings tab found yet, snoozing');
    setTimeout(initSettings, 400);
    return;
  }
  if(W.loginManager.user.areas)
  log('registering selection changed handler');
  W.selectionManager.events.register('selectionchanged', null, checkLock);
  getUserAreas();
  initBelgiumAreas();
}

function postUnlockToSlack(){
  let place = $('.location-info').text().replace(/\,.+$/i, '');
  let post_url = getSlackLockHook();
  let perma = getPermalink();
  let locked = getLockedAt();
  let user_level = 1 + W.loginManager.getUserRank();

  let reason = $('#reason').val();

  let msg = '<@' + W.loginManager.user.userName + '>: L' + locked + W.model.countries.top.abbr + ' ';
  msg += place + ' -> :n' + user_level + ': : ' + reason + ' ';
  msg += 'link: ' + perma;

  let channel = getUnlockChannel();

  let payload = {
    text: msg,
    mrkdwn: true,
    channel: channel
  }
  // log("Would post to: " + post_url);
  // window.console.log(payload);
  let posting = $.post( post_url, JSON.stringify(payload) );
  posting.done(function(data){
    alert('Request done in Slack!');
  });
}

