function determinCountry(){
  let selectedSegments = W.selectionManager.getSelectedFeatures();
  let middleSegment = selectedSegments[Math.round((selectedSegments.length - 1) / 2)];
  let country = middleSegment.model.getAddress().attributes.country.abbr;
  if (country === "NL"){
    log("We're in NL");
    return "NL";
  }
  if (country === "LU"){
    log("We're in LUX");
    return "LU";
  }
  // We seem to be editing in BE, need to determin if we need the FR or the BE
  let lonlat = getLonLat(middleSegment);
  if (isInsideFlanders(lonlat.lon, lonlat.lat)){
    log("We're in Flanders");
    return "BE";
  }
  if (isInsideWallonia(lonlat.lon, lonlat.lat)){
    log("We're in Wallonia");
    return "FR";
  }
  // Else we return Brussels
  if (country === "BE") {
    log("We must be in Brussels");
    return "BR";
  }
}

